def XRayM(obj):
    import FreeCAD as App
    import Show
    
    global libraryX
    if obj is None:
        for itobj in libraryX:
            tv = libraryX[itobj]
            tv.restore()
        libraryX = {}
        return
    if obj in libraryX:
        tv = libraryX.pop(obj)
        tv.restore()
    else:
        tv = Show.TempoVis(App.ActiveDocument)
        tv.modifyVPProperty(obj, 'Transparency', 80)
        #tv.modifyVPProperty(obj, 'DisplayMode', 'Shaded')
        tv.setUnpickable(obj)
        libraryX[obj] = tv
