def get_top_level (obj):
    lvl=10000
    top=None
    for ap in obj.InListRecursive:
        if hasattr(ap,'Placement') and ap.TypeId!='App::FeaturePython' and ap.TypeId!='Part::Part2DObjectPython':
            if len(ap.InListRecursive) < lvl:
                top = ap
                lvl = len(ap.InListRecursive)
    return top

